        "# mengoutputkan dalam notebook\n",
        "output_notebook()\n",
        "\n",
        "# membuat ColumnDataSource untuk data Indonesia\n",
        "ID_cds = ColumnDataSource(covid_idn)\n",
        "\n",
        "# membuat CDSView untuk tiap wilayah Indonesia\n",
        "JK_view = CDSView(source=ID_cds,\n",
        "                       filters=[GroupFilter(column_name='ISO_Code', group='ID-JK')])\n",
        "RI_view = CDSView(source=ID_cds,\n",
        "                        filters=[GroupFilter(column_name='ISO_Code', group='ID-RI')])\n",
        "JB_view = CDSView(source=ID_cds,\n",
        "                        filters=[GroupFilter(column_name='ISO_Code', group='ID-JB')])\n",
        "BT_view = CDSView(source=ID_cds,\n",
        "                        filters=[GroupFilter(column_name='ISO_Code', group='ID-BT')])\n",
        "JT_view = CDSView(source=ID_cds,\n",
        "                        filters=[GroupFilter(column_name='ISO_Code', group='ID-JT')])\n",
        "SG_view = CDSView(source=ID_cds,\n",
        "                        filters=[GroupFilter(column_name='ISO_Code', group='ID-SG')])\n",
        "BA_view = CDSView(source=ID_cds,\n",
        "                        filters=[GroupFilter(column_name='ISO_Code', group='ID-BA')])\n",
        "KI_view = CDSView(source=ID_cds,\n",
        "                        filters=[GroupFilter(column_name='ISO_Code', group='ID-KI')])\n",
        "YO_view = CDSView(source=ID_cds,\n",
        "                        filters=[GroupFilter(column_name='ISO_Code', group='ID-YO')])\n",
        "SU_view = CDSView(source=ID_cds,\n",
        "                        filters=[GroupFilter(column_name='ISO_Code', group='ID-SU')])\n",
        "\n",
        "# membuat dan mengonfigurasi figure yang akan digunakan\n",
        "ID_fig = figure(x_axis_type='datetime',\n",
        "                  plot_height=300, plot_width=600,\n",
        "                  title='Daily Vaccinations in South East Asia Nations',\n",
        "                  x_axis_label='Date', y_axis_label='New Cases')\n",
        "\n",
        "# memasukkan CDSView tiap negara ke dalam figure\n",
        "ID_fig.step('Date', 'New Cases',\n",
        "              source=ID_cds, view=JK_view,\n",
        "              color='#e6194b', legend_label='Jakarta', muted_alpha=0.1)\n",
        "ID_fig.step('Date', 'New Cases',\n",
        "              source=ID_cds, view=RI_view,\n",
        "              color='#3cb44b', legend_label='RIAU', muted_alpha=0.1)\n",
        "ID_fig.step('Date', 'New Cases',\n",
        "              source=ID_cds, view=JB_view,\n",
        "              color='#ffe119', legend_label='JawaBarat', muted_alpha=0.1)\n",
        "ID_fig.step('Date', 'New Cases',\n",
        "              source=ID_cds, view=BT_view,\n",
        "              color='#4363d8', legend_label='Banten', muted_alpha=0.1)\n",
        "ID_fig.step('Date', 'New Cases',\n",
        "              source=ID_cds, view=JT_view,\n",
        "              color='#f58231', legend_label='Jawa Tengah', muted_alpha=0.1)\n",
        "ID_fig.step('Date', 'New Cases',\n",
        "              source=ID_cds, view=SG_view,\n",
        "              color='#911eb4', legend_label='Sulawesi Tenggara', muted_alpha=0.1)\n",
        "ID_fig.step('Date', 'New Cases',\n",
        "              source=ID_cds, view=BA_view,\n",
        "              color='#46f0f0', legend_label='Bali', muted_alpha=0.1)\n",
        "ID_fig.step('Date', 'New Cases',\n",
        "              source=ID_cds, view=KI_view,\n",
        "              color='#f032e6', legend_label='Kalimantan Timur', muted_alpha=0.1)\n",
        "ID_fig.step('Date', 'New Cases',\n",
        "              source=ID_cds, view=YO_view,\n",
        "              color='#bcf60c', legend_label='Yogya', muted_alpha=0.1)\n",
        "ID_fig.step('Date', 'New Cases',\n",
        "              source=ID_cds, view=SU_view,\n",
        "              color='#fabebe', legend_label='Sumatara Utara', muted_alpha=0.1)\n",
        "\n",
        "# memindahkan legend ke sebelah kanan dari luar plot\n",
        "ID_fig.add_layout(ID_fig.legend[0], 'right')\n",
        "\n",
        "# fitur interaksi mute plot pada legend\n",
        "ID_fig.legend.click_policy = 'mute'\n",
        "\n",
        "# menampilkan hasil figure\n",
        "show(ID_fig)"
